		var nu5 = new sound("nu_sounds/Nu5.wav");
		var nu6 = new sound("nu_sounds/Nu6.wav");
		var nu7 = new sound("nu_sounds/Nu7.wav");
		var nu8 = new sound("nu_sounds/Nu8.wav");
